    "# find specific directory\n",
    "list.files(\"/kaggle/input/digital-wallet-transactions\")\n",
    "\n",
    "# load dataset\n",
    "digital_wallet <- read.csv(\"/kaggle/input/digital-wallet-transactions/digital_wallet_transactions.csv\")\n",
    "colnames (digital_wallet)\n",
    "\n",
    "# load package\n",
    "library(tidyverse)"
   ]
