   "source": [
    "# How does the average transaction frequency vary by payment method?\n",
    "\n",
    "transaction_count <- digital_wallet %>%\n",
    "group_by (payment_method)%>%\n",
    "summarise(transaction_count = n(),.groups='drop')%>%\n",
    "arrange(desc(transaction_count))\n",
    "\n",
    "# print results\n",
    "print (transaction_count)\n",
    "\n",
    "# visualize output\n",
    "ggplot(data=transaction_count, mapping=aes(x=payment_method, y=transaction_count))+geom_point(size=5, color='red')+\n",
    "labs(title='Average Transaction by Payment Method') "
   ]
  },
